import Card from "../UI/Card";

function NMForm() {
  return (
    <div>
      <Card>
        <form className="">
            <div>
                <label htmlFor="title">Title</label>
                <input type="text" name="title" required id="title" />
            </div>
        </form>
      </Card>
    </div>
  );
}

export default NMForm;
